Pyramid Rising is an exciting Time Management game! As assistant to the Royal architect Senmut, you have been appointed the daunting task of reconstructing villages and repairing Egypt. Only you can save them from banishment to eternal darkness by the mighty god, Amen-Ra. Hire workers, manage resources, build structures and gather stone all while fending off alligator attacks and more!

Features:

    Help to establish the Egyptian Empire by building and upgrading your own villages!
    40 unique levels, PLUS 15 extra levels available in the Chaos On The Nile level pack!
    Unbelievably addictive game play -- race the clock to earn Golden Scarabs for each level
    Manage your workers and resources while completing tasks and improving your strategies

